  render() {
    return <div>
        <ReactPlayer url='https://www.youtube.com/watch?v=ysz5S6PUM-U' controls={true} onProgress={(progress) => {
       setPlayed(progress.playedSeconds);
     }}/>
    </div>;
  }
}
